import { Dialog , Box} from "@mui/material"

const dialogStyle = {
    height: '96%',
    marginTop: '12%',
    width: '60%',
    maxWidth: '100%',
    boxShadow: 'none'
}

const LoginDialog = () => {

    return (
        <Dialog
        open={true}
        PaperProps={{sx: dialogStyle}}>

        <Box></Box>

        </Dialog>
    )
}

export default LoginDialog
